import React from "react";
import { Image } from "react-native";
import styled from "styled-components/native";

const Header = styled.View`
  flex-direction: row;
  background-color: #ddd;
  flex-wrap: wrap;
  justify-content: center;
  margin-top: 3px;
  border: 3px solid transparent;
  border-image: linear-gradient(
    to bottom right,
    #b827fc 0%,
    #2c90fc 25%,
    #b8fd33 50%,
    #fec837 75%,
    #fd1892 100%
  );
  border-image-slice: 1;
`;

const Quadrado = styled.View`
  background-color: ${(props) => props.cor};
  height:150px;
  width:150px;
  justify-content: center;
  align-items: center;
  border: 2px;
`;
const Pagina = styled.View`
  flex: 1;
  align-items: center;
  flex-direction: column;
`;

const Texto = styled.Text`
  font-size: 35px;
  color: #0000ff;
`;

function App() {
  return (
    <Pagina>
      <Texto>Galeria de imagens do Ajax Lima</Texto>
      <Texto style={{color:'red'}}>Unic√≥rnios</Texto>
      <Header>
        <Quadrado cor="green">
          <Image
            source={require("./src/imagens/Rino1.jpg")}
            style={{ width: 100, height: 100, backgroundColor: "#aaa" }}
            resizeMode="cover"
          />
        </Quadrado>
        <Quadrado cor="blue" style={{ marginLeft: "1px" }}>
          <Image
            source={require("./src/imagens/Rino2.jpg")}
            style={{ width: 100, height: 100, backgroundColor: "#aaa" }}
            resizeMode="center"
          />
        </Quadrado>
      </Header>
      <Header>
        <Quadrado cor="green">
          <Image
            source={require("./src/imagens/Rino3.jpg")}
            style={{ width: 100, height: 100, backgroundColor: "#aaa" }}
            resizeMode="cover"
          />
        </Quadrado>
        <Quadrado cor="blue" style={{ marginLeft: "1px" }}>
          <Image
            source={require("./src/imagens/Rino4.jpg")}
            style={{ width: 100, height: 100, backgroundColor: "#aaa" }}
            resizeMode="center"
          />
        </Quadrado>
      </Header>
      <Header>
        <Quadrado cor="purple" style={{ width: 300 }}>
          <Image
            source={{
              uri:
                "https://seresmitologicos.com.br/wp-content/uploads/unicornio-1024x555.jpg",
            }}
            style={{ width: 250, height: 100, backgroundColor: "#aaa" }}
            resizeMode="center"
          />
        </Quadrado>
      </Header>
    </Pagina>
  );
}

export default App;
